  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Flint
  Hills National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
  refuge activities during the 1994 calendar year.  The report begins with a summary
  of the yearu2019s highlights and climatic conditions.   Land acquisition-including
  fee title, and other items- is also covered.  The report includes a planning section
  which discusses management plans, compliance with environmental and cultural resource
  mandates.  Refuge administration is outlined; information about personnel, youth
  programs, other manpower programs, volunteer programs, funding , safety and other
  items is given.  Habitat management is also covered.  Subjects include wetlands,
  forests, crop-land, grasslands, grazing, haying, fire management, pest control,
  and water rights.  The wildlife section of the report discusses endangered and/or
  threatened species, waterfowl, march and water birds, shorebirds, gulls, terns and
  allied species, raptors, other migratory birds, other resident wildlife and scientific
  collections.  The public uses of the refuge described in this report include general,
  outdoor student classrooms, interpretive foot trails, interpretive exhibits and
  demonstrations, other interpretive programs, hunting, fishing, wildlife orientation,
  other wildlife oriented recreation, picnicking, and law enforcement.  The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, and equipment utilization and replacement.  Items of interest are
  provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
